import os
import json
from datetime import datetime

class User:
    def __init__(self, username):
        self.username = username
        self.submissions = []

class Broker:
    def __init__(self):
        self.users = {}
        self.published_submissions = {}

    def add_user(self, username):
        if username not in self.users:
            self.users[username] = User(username)
            return f"User {username} added."
        return f"User {username} already exists."

    def upload_submission(self, username, submission):
        if username not in self.users:
            return "User does not exist."

        if submission['id'] in self.published_submissions:
            return "Duplicate submission detected."

        self.users[username].submissions.append(submission)
        return "Submission uploaded successfully."

    def process_deletions(self, date):
        date = datetime.strptime(date, '%Y-%m-%d').date()
        to_delete = []
        for submission_id, submission_date in self.published_submissions.items():
            if submission_date < date:
                to_delete.append(submission_id)

        for submission_id in to_delete:
            del self.published_submissions[submission_id]

        return f"Deleted submissions before {date}."

    def get_published_files(self):
        return list(self.published_submissions.keys())

class Validator:
    def validate_duns(self, duns):
        return len(duns) == 9 and duns.isdigit()

    def validate_required_fields(self, submission):
        required_fields = ['id', 'duns', 'data']
        for field in required_fields:
            if field not in submission:
                return False
        return True

def main():
    broker = Broker()
    validator = Validator()

    # Example of adding users
    print(broker.add_user("user1"))

    # Example submission
    submission = {
        'id': 'submission1',
        'duns': '123456789',
        'data': 'Sample data for processing',
        'date': datetime.now().date()
    }

    # Validate submission
    is_valid_duns = validator.validate_duns(submission['duns'])
    are_fields_valid = validator.validate_required_fields(submission)

    if is_valid_duns and are_fields_valid:
        print(broker.upload_submission("user1", submission))
        broker.published_submissions[submission['id']] = submission['date']
        print("Submission published.")
    else:
        print("Submission validation failed.")

    # Getting published files
    print("Published files:", broker.get_published_files())

    # Process deletions
    print(broker.process_deletions('2023-01-01'))

if __name__ == "__main__":
    main()
